DROP TABLE IF EXISTS `clientes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `clientes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `documento` decimal(10,0) NOT NULL,
  `fechanac` date DEFAULT NULL,
  `nombre` varchar(45) NOT NULL,
  `apellido` varchar(45) NOT NULL,
  `telefono` varchar(15) NOT NULL,
  `domicilio` varchar(255) NOT NULL,
  `dpto` smallint(6) DEFAULT NULL,
  `piso` smallint(6) DEFAULT NULL,
  `block` varchar(3) DEFAULT NULL,
  `sexo` tinyint(4) DEFAULT NULL COMMENT 'Sexo 0 - Femenino 1 - Masculino',
  `foto` blob,
  `tallercito_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `documento_UNIQUE` (`documento`),
  KEY `fk_clientes_tallercitos1_idx` (`tallercito_id`),
  KEY `fk_clientes_users1_idx` (`user_id`),
  CONSTRAINT `fk_clientes_tallercitos1` FOREIGN KEY (`tallercito_id`) REFERENCES `tallercitos` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_clientes_users1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;
